<script setup>
import IconColumn from "./partials/IconColumn.vue";
</script>
<template>
	<div>
		<IconColumn :defaultIcons="defaultIcons" :availableIcons="defaultIcons" :largeIcon="true" :limit="1"  :title="title" :pluralTitle="pluralTitle" />
	</div>
</template>

<script>
import draggable from "vuedraggable";

export default {
	name: 'AnalyticsQuerying',
	components: {
		draggable
	},
	data() {
		return {
			title: 'Analytics and Querying',
			pluralTitle: 'Analytics and Querying',
			defaultIcons: [
				{
					name: "CPU",
					id: 0,
					single: true,
					raw: '<svg class="icon w-36 h-36" viewBox="0 0 382 354" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"><image id="Image-Layer" x="0" y="0" xlink:href="data:image/png;base64, "/></svg>'
				},
			]
		};
	},
	methods: {
		add: function (id) {
			if (!this.canAdd(id)) {
				console.log('method says no!')
				return false;
			}

			let index = this.availableIcons.findIndex(item => item.id === id);
			this.icons.push(
			    this.availableIcons[index]
			);
		},
		doDelete(id) {
			let index = this.icons.findIndex(item => item.id === id);
			this.icons.splice(index, 1);
		},
		clear() {
			this.icons = [];
		},
		canAdd(id) {
			let index = this.icons.findIndex(item => item.id === id);

			if ( this.limit <= this.iconsCount ) {
				return false;
			}

			// if not present it can be added
			if (index < 0) { // if not found, index will be -1
				return true;
			}
			// icon has been added, check if it wants to be single
			let icon = this.icons[index];
			if (icon.single) {
				return false;
			}
			return true;
		},
		annotation() {
			console.log(this.icons);
			this.icons.push(
			    {
				    'text': "Click Here to Edit."
			    }
			);
			console.log(this.icons);
		},
	},
	computed: {
		iconsCount() {
			return this.icons.length
		}
	}
}
</script>


